import React, {Component} from 'react';
import Dashboard from './components/Dashboard';
import './App.css';

class App extends Component {
  manageCP =(occupied, id)=> {
   const url = "http://localhost:8080/cpm/management/"  + (occupied ? "unplug/" : "plug/") + id;
   console.log(">>>>>>>>>>>>>>", url);
   fetch(url, {
      method: 'PUT'
   }).then((res) => {
     console.log(res);
   }).catch(err => {
    console.error(err)
  });
 }

    render() {
        return (
            <div className="app">
              <div className="app-header">Charging Point Management</div>
              <Dashboard cps={this.state.cps}/>
            </div>
        )
    }

    state = {
        cps: []
    };

    componentDidMount() {
        fetch('http://localhost:8080/cpm/dashboard')
            .then(res => res.json())
            .then((data) => {
                this.setState({ cps: data })
            })
            .catch(console.log)
    }
}

export default App;
